import React, { useEffect, useState } from "react";
const Vans = () => {
  const [vans, setVans] = useState([]);

  useEffect(() => {
    fetch("/api/vans")
      .then((res) => res.json())
      .then((data) => setVans(data.vans));
  }, []);

  return (
    <div className="data">
      {vans.map((item) => {
        const { title } = item;
        return (
          <div className="item">
            <div className="" key={item.id}>
              {title}
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default Vans;
